import React from 'react'
import { useContext } from 'react'
import NoteContext from '../Context/Notes/NoteContext';

const About = () => {
    const {name, branch} = useContext(NoteContext);
    return (
        <div>
            My name is {name} and my branch is {branch}
        </div>
    )
}

export default About
